export const tableConstants = () => {
  return [
    {
      title: 'SL. No',
      render: rowData => {
        return <span>{rowData.id}</span>;
      },
    },
    {
      title: 'ICCID / SN',
      render: rowData => {
        return <span>{rowData.iccid}</span>;
      },
    },
    {
      title: 'MDN',
      render: rowData => {
        return <span>{rowData.mdnNo}</span>;
      },
    },
    {
      title: 'FG Code',
      render: rowData => {
        return <span>{rowData.fgCode}</span>;
      },
    },
    {
      title: 'DO NUMBER',
      render: rowData => {
        return <span>{rowData.doNumber}</span>;
      },
    },

